import Link from 'next/link'
import Layout from '../../component/Layout'
import styles from './about.module.scss'

const about = () => {
  return (
    <Layout>

    <div style={styles} className={styles.container}>

        <h1 className="text">hello about</h1>
    </div>


  <style jsx global>{`
    body{
        padding : 0px;
        margin : 0px;
        overflow-x : hidden;
    }

  `}</style>

    </Layout>
  )
}

export default about
